import Nav from './Nav';
import Logo from "./icon/Logo.svg";

function Header(){
    return(
        <div className="Header">
            <img id="logo" src={Logo}/>
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Menu</li>
                <li>Reservations</li>
                <li>Order Online</li>
                <li>Login</li>
            </ul>
            {/* <Nav/> */}
        </div>
    );
}

export default Header;
